// src/components/Dashboards/CoachDashboards/NavigationPanel.jsx
import React from 'react';
import './CoachDashboards.css';

export default function NavigationPanel({ activeTab, onTabChange }) {
  return (
    <nav className="nav-panel">
      <button
        className={activeTab === 'my-trainings' ? 'active' : ''}
        onClick={() => onTabChange('my-trainings')}
      >
        Ваші тренування
      </button>
      <button
        className={activeTab === 'profile' ? 'active' : ''}
        onClick={() => onTabChange('profile')}
      >
        Ваш профіль
      </button>
    </nav>
  );
}
